  const Map = Map({
    accessToken:
      "pk.eyJ1Ijoic2F5b2J5ZSIsImEiOiJjazVudWMyMzkwN2t5M2tucnR5d3BhMzhxIn0.UkVYqNYpslpkTgnsYPHbfA"
  });




  return (
    <div className="App">
       <Map
          initialViewState={{
            longitude: -122.4,
            latitude: 37.8,
            zoom: 14
          }}
          style={{width: 600, height: 400}}
          mapStyle="mapbox://styles/mapbox/streets-v9"
        />
    </div>
  );


}

export default App;
